const MyPage = () => {
    return(
        <section className="mypage__main">
            <div className="mypage__container">
                <div className="mypage__wrapper">
                    <p className="mypage__detail"> My Page</p>
                </div>
            </div>
        </section>
    )
}

export default MyPage;
